text:
@AndrewYang More of us need to be out in public spreading the word about Andrew Yang and his core values! 
The Media won<U+2019>t do it for us, and Twitter isn<U+2019>t enough. 
Join your local #YangGang chapters on Facebook and talk to its organizers on how you can get involved locally in your community.

I have a lot of friends at tech companies who work on automating away jobs. They don<U+2019>t feel great about it, but everyone assumes we<U+2019>re headed towards a future of robots and UBI. This is by far the consensus view in tech. 

@AndrewYang is the future. 

#YangGang
